import {registrationApi} from '../api/registration';
const registrationForm = (email, password, setToken, setUserData, setErrorMessage) => {
    if(!email || !password){
        return false;
    }
    const data = {
        email,
        password
    }
    const responseState = registrationApi(data, setErrorMessage, setToken, setUserData);
    return responseState;

}
export {registrationForm};
